import React, { Component } from 'react';
import { ScrollView, View, Alert, KeyboardAvoidingView } from 'react-native';
import { TextInput, Button, Card, Avatar, Title, Snackbar, Appbar, RadioButton, Provider as PaperProvider } from 'react-native-paper';
import { setStatusBarHidden, StatusBar } from 'expo-status-bar';

class SignUp extends Component {

    constructor(props) {
        super(props)
        this.state = {
            email: "",
            username: "",
            password: "",
            phone: "",
            cnic: "",
            gender: ""
        }
    }

    onSignUp = () => {
        var data = {
            "email": this.state.email,
            "username": this.state.username,
            "password": this.state.password,
            "phone": this.state.phone,
            "cnic": this.state.CNIC,
            "gender": this.state.Gender
        }

        fetch("http://3e5b5e4b818d.ngrok.io/register", {
            method: "POST",
            body: JSON.stringify(data)
        })
            .then(function (response) {
                return response.json();
            })
            .then(function (data) {
                console.log(data)
            });


        Alert.alert(
            "Alert Title",
            "My Alert Msg",
            [
                {
                    text: "Cancel",
                    onPress: () => console.log("Cancel Pressed"),
                    style: "cancel"
                },
                { text: "OK", onPress: () => console.log(this.state) }
            ],
            { cancelable: false }
        );
    }

    render() {

        const { userName, password, emailID, phoneNumber, CNIC, Gender } = this.state
        return (
            <View style={{ flex: 1, justifyContent: 'center' }}>
                <View style={{ width: '100%', alignSelf: 'center' }}>
                    <StatusBar style="auto" />
                    <KeyboardAvoidingView>
                        <Card>
                            <Card.Content>
                                <Title>Sign Up</Title>
                                <TextInput
                                    label="Email Address"
                                    value={emailID}
                                    onChangeText={text => this.setState({ emailID: text })}
                                />
                                <TextInput
                                    style={{ marginTop: 10 }}
                                    label="User Name"
                                    value={userName}
                                    onChangeText={text => this.setState({ userName: text })}
                                />
                                <TextInput
                                    style={{ marginTop: 10 }}
                                    secureTextEntry={true}
                                    label="Password"
                                    value={password}
                                    onChangeText={text => this.setState({ password: text })}
                                />
                                <TextInput
                                    style={{ marginTop: 10 }}
                                    label="Phone Number"
                                    value={phoneNumber}
                                    onChangeText={number => this.setState({ phoneNumber: number })}
                                />
                                <TextInput
                                    style={{ marginTop: 10 }}
                                    label="CNIC Number"
                                    value={CNIC}
                                    onChangeText={number => this.setState({ CNIC: number })}
                                />
                                <TextInput
                                    style={{ marginTop: 10 }}
                                    label="Gender"
                                    value={Gender}
                                    onChangeText={text => this.setState({ Gender: text })}
                                />
                                <Card.Actions style={{ justifyContent: 'center' }}>
                                    <Button style={{ marginTop: 10, justifyContent: 'center' }} contentStyle={{ height: 50 }}
                                        icon='login' mode="contained"
                                        onPress={() => this.onSignUp()}>
                                        Sign Up
                                </Button>
                                </Card.Actions>
                            </Card.Content>
                        </Card>
                    </KeyboardAvoidingView>
                </View>
            </View>
        )
    }
}
export default SignUp
